fn find_edges(node: &'static str) -> Vec<&'static str> {
  INPUT.iter()
    .filter(|(a,b)| *a == node || *b == node)
    .map(|(a,b)| if *a == node { *b } else { *a })
    .collect::<Vec<_>>()
}

fn find_path_len(at: &'static str, visited: &mut HashSet<&'static str>) -> Option<usize> {
  if visited.contains(at) { return None; }
  visited.insert(at);
  if at == "SAN" { return Some(1); }
  let o = find_edges(at).iter()
    .map(|s| find_path_len(s, visited))
    .find(|o| o.is_some())
    .unwrap_or(None);
  match o {
    Some(i) => Some(i+1),
    None => None
  }
}

